import UserButton from "./UserButton";
import "./componentStyle.css";

interface Props {
  user: string;
  onButClick: (buttonType: string) => void;
}

const UserChoice = (props: Props) => {
  const handleClick = (
    event: React.MouseEvent<HTMLButtonElement, MouseEvent>
  ) => {
    if (event.currentTarget.type === "Patient") {
      console.log("Hi");
      const data = "some data from button 1";
      props.onButClick(data);
    } else if (event.currentTarget.name === "button2") {
      const data = "some data from button 2";
      props.onButClick(data);
    }
  };

  return (
    <>
      <main
        className="govuk-main-wrapper app-main-class"
        id="main-content"
        role="main"
      >
        <table className="center">
          <tr>
            <th>
              <UserButton type="Patient" onClick={() => handleClick} />
            </th>
            <th>
              <UserButton type="Doctor" onClick={() => handleClick} />
            </th>
            <th>
              <UserButton type="Admin" onClick={() => handleClick} />
            </th>
          </tr>
        </table>
      </main>
    </>
  );
};

export default UserChoice;
